import React, {useEffect,useState} from "react";
import axios from "axios";





const Cards = ({ breed }) => {
  const [dogs, setDogs] = useState([]);
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    const fetchDogs = async () => {
      setLoading(true);
      try {
        const response = await axios.get(
          'https://frontend-take-home-service.fetch.com/dogs/search',
          {withCredentials:true,
            params: {
              breeds: [breed],
            },
          }
        );
        setDogs(response.data.resultIds);
      } catch (error) {
        console.log(error);
      } finally {
        setLoading(false);
      }
    };
    fetchDogs();
  }, [breed]);

  if (loading) {
    return <p>Loading...</p>;
  }

  return (
    <div>
      {dogs.map((dog) => (
        <Card key={dog.id} dog={{  name: dog.name, breed: dog.breed, age: dog.age, zipCode: dog.zipCode }} />
        ))}

    </div>
  );
};

const Card = ({ dog }) => {
  return (
    <div>
      <h2>{dog.name}</h2>
      <p>Breed: {dog.breed}</p>
      <p>Age: {dog.age}</p>

      <p>Zip Code: {dog.zipCode}</p>


    </div>
  );
};

export default Cards;




